31201=        HollySys Automation Technologies is a leading provider of automation and control technologies and applications in China that enables its diversified industry and utility customers to improve operating safety, reliability, and efficiency.
31202=        Founded in 1993, NASDAQ listed in 2008 (HOLI). After 20 years steady development, HollySys has become an international famous brand in automation industry.
31203=        HollySys has approximately 5000 employees and  bases in Beijing, hangzhou, xi 'an and Singapore, nationwide presence in over 60 cities in China,and more than 60 service organizations in China and abroad.
31204=        In process automation industry, HollySys' industrial control systems are successfully put into use in many critical projects and key technical Equipment's, such as million kilowatt ultra-supercritical coal-fired power station DCS project, ten million tons of oil refining device, million kilowatt nuclear I&C system project.It has accumulated over 12,000 applications in thermal power generation, petrochemical industry, fine chemical industry, metallurgical building materials and food and beverage industry.
31205=        In factory automation industry, HollySys has got certificates of many international standards, UL, CE for its PLC and MC series motion controller, which helps HollySys to provide professional and integrated product solution to wide range of customers in various industries of subway, mine, water treatment, machine and equipment's control, etc.
31206=        In transportation automation field, HollySys has also possessed the capability in safety system and its proprietary signaling system and other products have been awarded international safety certification, The train safety control system for 350km/h high speed railway and the SCADA system are widely and successfully applied in Chinese and international railway and subway market.
31207=        HollySys is the State Enterprise Technology Center, the national innovation enterprise, outstanding post-doctoral research station, major national commitment to science and technology projects, more than 20 863, National Development and Reform Commission issued the "National High-tech Industry Achievement Award Decade "; It has more than 200 patents and software copyright of its own products, including 35 patents for invention. Participate in and presided over a number of the formulation of national standards, of which 2011 hollysys prepared the rail transit industry standards have released three become national standards, hollysys automation industry is growing as the setter and rule makers.  
31209=        As the leading automation company, HollySys is now making its best effort to be the Most Valuable Automation Company through Stable and Sustainable Growth.
